import React from "react";
import Header from "./components/Header";
import Hero from "./components/Hero";
import ProjectShowcase from "./components/ProjectShowcase";
import Footer from "./components/Footer";

function App() {
  return (
    <div>
      <Header />
      <section id="home">
        <Hero />
      </section>
      <section id="projects">
        <ProjectShowcase />
      </section>
      <section id="contact">
        <Footer />
      </section>
    </div>
  );
}

export default App;
